import Header from '../components/header';
import Video from '../components/herovideo';
import Intro from '../components/intro';

const Index = () => (
    <div>
        <Header />
        <Video />
        <Intro />
      <style jsx>{`
            * {
                font-family: Futura; 
            }
      `}</style>
    </div>
)

export default Index
